import "./App.css";
import Navbar from "./Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Navbar />
        <Routes>
          <Route path="/" element={<h1>Hello world</h1>}></Route>
        </Routes>
        <h1>E-commerce website</h1>
      </BrowserRouter>
    </div>
  );
}

export default App;
